import React from 'react';
import Footer from '../../Footer/Footer';
import Header from '../Header';
 import './Gallery.css'
 import Paper from '@material-ui/core/Paper';
 import Tabs from '@material-ui/core/Tabs';
 import Tab from '@material-ui/core/Tab';
 import { AiFillHeart , AiFillCamera  , AiOutlineRise } from "react-icons/ai";

function Gallery() {
    const [value, setValue] = React.useState(2);

    const handleChange = (event, newValue) => {
      setValue(newValue); };
     
  return (
    <>
      <Header />
      
      <div className="box-main">
        {/* <div className="box-flex">
        <div className="text-icon" style={{marginRight:'30px'}}>
        <AiFillHeart style={{color:"#00bf96"}}/>
            <span> محبوب </span>
        </div>

        <div className="text-icon"    >
        <AiFillCamera  style={{color:"#00bf96"}}/>
            <span> تازه ها </span>
        </div>

        <div className="text-icon">
        <AiOutlineRise  style={{color:"#00bf96"}}/>
            <span>    درحال پیشرفت </span>
        </div>
        </div> */}
         <Paper square>
      <Tabs
        value={value}
        indicatorColor="primary"
        textColor="primary"
        onChange={handleChange}
        aria-label="disabled tabs example"
      >
        <Tab label="Active" />
        <Tab label="Disabled" disabled />
        <Tab label="Active" />
      </Tabs>
    </Paper>
      </div>

      <Footer />
    </>
  );
}

export default Gallery;
